import React from "react";
import {
  Card,
  CardContent,
  Typography,
  Paper,
} from "@mui/material";
import GetAllEquities from "./equities/GetAllEquities";

const ModernCardTable = () => {
  return (
    <Card sx={{ maxWidth: 600, margin: "auto", mt: 5, boxShadow: 3, borderRadius: 2 }}>
      <CardContent>
        <Typography variant="h5" gutterBottom>
          User Information
        </Typography>
        <Paper sx={{ boxShadow: 1, borderRadius: 1 }}>
          <ExistingTableComponent />
        </Paper>
      </CardContent>
    </Card>
  );
};

export default ModernCardTable;
